import React from 'react';
import SearchCity from './SearchCity';
import styled from 'styled-components';

const Container = styled.div`
display:flex;
width:80%;
height:100%;
align-items: center;
`;
const App = ()=> {
  
  return(
    <Container>
       <SearchCity />
    </Container>
    
    );
}
export default App;
